name is **Yousef**, a junior *Data Scientist* and *Data Dnalyst* from **Brazil** and This is my first analysis project and is dedicated for the *Google Data Analytics Capstone* - *Case Study 2* .    \n","    This project has been done by the tools of **Google Sheets**, **PostgreSQL** and **R Studio** platforms whenever it was necessary. \n","  The full document to the case study can be found in the [Google Data Analytics Capstone](https://www.coursera.org/learn/google-data-analytics-capstone/).\n","\n","This project will use Data Analytics fundamental steps as follows:\n","**1. Ask 2. prepare 3. Process 4. Analyze 5. Share 6. Act**\n","\n","\n","# About the company\n","Bellabeat, is a high-tech manufacturer of health-focused products for women. [Bellabeat](https://bellabeat.com) is a successful small company based on art and technology, but focused only on women users in the global smart device market. [Urška Sršen](https://www.linkedin.com/in/urskasrsen/), Co-Founder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data . Then, using this information, and high-level recommendations for how these trends can inform Bellabeat marketing strategy could help unlock new growth opportunities for the company.\n","\n","# Requirements\n","### Ask Phase\n","\n","1. What are some trends in smart device usage? \n","2. How could these trends apply to Bellabeat customers? \n","3. How could these trends help influence Bellabeat marketing strategy\n","\n","\n","## Business tasks and metric goals\n","\n","Identify potential opportunities for grow the business and recommendations for the Bellabeat marketing strategy improvement based on trends in smart device usage.\n","\n","\n","# Preparing the data \n","### Prepare Phase\n","\n","\n","#### Datasets\n","This project will use the data provided by [Möbius](https://www.kaggle.com/arashnic)  a Data Scientist at Healthcare area from Melbourne, Australia with [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit).\n","I will verify the trends in 24hrs scale so the datasets I'll use daily-based datasets as follows:\n","\n","| Table Name | Type | Description |\n","| :--- | :-: | --------------- |\n","| dailyActivity_merged | CSV File | Daily Activity over 31 days of 33 users. Tracking daily: Steps, Distance, Intensities, Calories |\n","|dailyCalories_merged | CSV File | Daily Calories over 31  days of 33 users |\n","| dailyIntensities_merged | CSV File | Daily Intensity over 31 days of 33 users. Measured in Minutes and Distance, dividing groups in 4 categories: Sedentary, Lightly Active, Fairly Active,Very Active |\n","| dailySteps_merged | CSV File | Daily Steps over 31 days of 33 users | \n","| sleepDay_merged | CSV File | Daily sleep logs, tracked by: Total count of sleeps a day, Total minutes, Total Time in Bed |\n","| weightLogInfo_merged | CSV File | Weight track by day in Kg and Pounds over 30 days. Calculation of BMI.5 users report weight manually 3 users not.In total there are 8 users |\n","* *Here in Kaggle we will use the direct addressing the datasets which is already sotred in here but I will exlain the normal procedure of doing my analysis in a local hard drive as well.*  \n","  \n","    \n","    \n","  \n","\n","## The very first step\n","\n","\n","### Naming convention\n","\n","When I downloaded the datasets I saw that they needed to be renamed, so the file name convention has been executed to the datasets by removing **\"_merged\"**, which was redundant and unifying the file names by separating words with an underscore alongside consistent lowercase letters.\n","\n","### Verifying the datasets in spreadsheets abd SQL\n","Importing data in [Google Sheets](https://docs.google.com/spreadsheets) and pgAdmin4(an IDE for PostgreSQL), to have a quick look of what's inside of every datasets. After filtering and sorting some specific IDs and verifying the behavior of the data we are ready to dive deeper and have some quick analysis and visualizations. Since the data sets are not in large scales, so we can do all the analysis we want for this capstone in R Studio\n","\n","## Guiding questions\n","\n","* **Data location**\n","The data is securely saved in iCloud.\n","* **Data organization**\n","The data is organized by month, each on a csv archives.\n","* **Credibility and bias verification with ROCCC**\n","These datasets are released by it's own company, and for privacy security there is no name, address or financial information published in these datasets. However these datasets are not all recently distributed so they are no current for have the best analysis; also the quantity of participants is so low that make the bias margin range in a wide area. As a result this datasets aren't completely ROCCCs because however they're reliable, originally published by the manufacturer, comprehensive and cited but they are not current.\n","* **Privacy, security, and accessibility**\n","The manufacturer company has the full rights to publish this data and license it for public analysis, also there is no personal information of any users in them. Also they are a text based data in CSV format which is not incluing any visual data.\n","* **Data’s integrity**\n","All the files have consistent columns and each column has the correct type of data, although they are a third-party dataseys which means that data has been collected from outside resources who did not collect it directly.\n","* **Data efficiency for business problem solving**\n","These datasets might have some key insights about the products usage data and improving the quality and usability of them which will end up to answer the [Business tasks and metric goals](##Business tasks and metric goals)\n","* **Problems with the data**\n","It is necessary to constantly update these datasets to have the most recent information and help stakeholders to have the best data-driven decision makings. Also the quantity of participants must be in a wider range to have a lower bias margin."]},{"cell_type":"markdown","id":"1f6d318c","metadata":{"papermill":{"duration":0.007001,"end_time":"2022-09-25T01:17:25.747975","exception":false,"start_time":"2022-09-25T01:17:25.740974","status":"completed"},"tags":[]},"source":["So we have will begin the process by loading our packages in R.\n","\n","![](https://media.istockphoto.com/vectors/let-the-adventure-begin-beautiful-travel-and-adventure-quote-modern-vector-id1251656297?b=1&k=20&m=1251656297&s=612x612&w=0&h=TyA89e9kkdEToo_3gGA_d8gHJtjJxxo7qv_gaeVe458=)\n","\n"]},{"cell_type":"code","execution_count":1,"id":"c3b7184c","metadata":{"_kg_hide-input":true,"_kg_hide-output":false,"execution":{"iopub.execute_input":"2022-09-25T01:17:25.767008Z","iopub.status.busy":"2022-09-25T01:17:25.764896Z","iopub.status.idle":"2022-09-25T01:17:27.301498Z","shell.execute_reply":"2022-09-25T01:17:27.299688Z"},"papermill":{"duration":1.548069,"end_time":"2022-09-25T01:17:27.303965","exception":false,"start_time":"2022-09-25T01:17:25.755896","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘scales’\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    discard\n","\n","\n","The following object is masked from ‘package:readr’:\n","\n","    col_factor\n","\n","\n"]}],"source":["library(tidyverse)\n","library(janitor)\n","library(skimr)\n","library(lubridate)\n","library(scales)"]},{"cell_type":"markdown","id":"528a0b10","metadata":{"papermill":{"duration":0.00769,"end_time":"2022-09-25T01:17:27.319849","exception":false,"start_time":"2022-09-25T01:17:27.312159","status":"completed"},"tags":[]},"source":["As we mentioned in the [Prepare Phase](### (Prepare Phase)), we are going to use the FitBit datasets provided by Möbius and we will import them in the platform to begin our analysis."]},{"cell_type":"code","execution_count":2,"id":"6f5deaae","metadata":{"execution":{"iopub.execute_input":"2022-09-25T01:17:27.37329Z","iopub.status.busy":"2022-09-25T01:17:27.337295Z","iopub.status.idle":"2022-09-25T01:17:27.500516Z","shell.execute_reply":"2022-09-25T01:17:27.49748Z"},"papermill":{"duration":0.175432,"end_time":"2022-09-25T01:17:27.503126","exception":false,"start_time":"2022-09-25T01:17:27.327694","status":"completed"},"tags":[]},"outputs":[],"source":["daily_activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\n","daily_calories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv\")\n","daily_intensity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv\")\n","daily_steps <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailySteps_merged.csv\")\n","daily_sleep <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")\n","daily_weight <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\")"]},{"cell_type":"markdown","id":"4fb4bc21","metadata":{"papermill":{"duration":0.008109,"end_time":"2022-09-25T01:17:27.519546","exception":false,"start_time":"2022-09-25T01:17:27.511437","status":"completed"},"tags":[]},"source":["We already had a quick view on datasets in Google Sheets and SQL, but we need to be sure that the data has been imported properly, also to have a really nice and quick summary of our datasets which is the first thing we might need for having some ideas about where to begin our data-digging and visualizing the patterns.\n","First let's see how many users participated in each category."]},{"cell_type":"code","execution_count":3,"id":"d863f433","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-25T01:17:27.538995Z","iopub.status.busy":"2022-09-25T01:17:27.537165Z","iopub.status.idle":"2022-09-25T01:17:27.603103Z","shell.execute_reply":"2022-09-25T01:17:27.601396Z"},"papermill":{"duration":0.078044,"end_time":"2022-09-25T01:17:27.605376","exception":false,"start_time":"2022-09-25T01:17:27.527332","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["33"],"text/latex":["33"],"text/markdown":["33"],"text/plain":["[1] 33"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["24"],"text/latex":["24"],"text/markdown":["24"],"text/plain":["[1] 24"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["8"],"text/latex":["8"],"text/markdown":["8"],"text/plain":["[1] 8"]},"metadata":{},"output_type":"display_data"}],"source":["n_distinct(daily_activity$Id)\n","n_distinct(daily_calories$Id)\n","n_distinct(daily_intensity$Id)\n","n_distinct(daily_steps$Id)\n","n_distinct(daily_sleep$Id)\n","n_distinct(daily_weight$Id)"]},{"cell_type":"markdown","id":"3e10bfa3","metadata":{"papermill":{"duration":0.008804,"end_time":"2022-09-25T01:17:27.623013","exception":false,"start_time":"2022-09-25T01:17:27.614209","status":"completed"},"tags":[]},"source":["There is 33 participants in the activity, calories and intensities datasets, 24 in the sleep and only 8 in the weight dataset. \n","As the recommendation the Central Limit Theorem (CLT) in the field of probability and statistics the minimum recommended sample size is 30 since as sample size increases, the results more closely resemble the normal (bell-shaped) distribution from a large number of samples. A sample of 30 is the smallest sample size for which the CLT is still valid. For more information please visit [Encyclopedia of Mathematics](https://encyclopediaofmath.org/index.php?title=Central_limit_theorem) and [MathWorld](https://mathworld.wolfram.com/CentralLimitTheorem.html).  \n","\n","As it is obvious, eight participants is definitely not sufficient to make any conclusions or data-driven decision but we will use it for picturing some basic analysis."]},{"cell_type":"code","execution_count":4,"id":"5d48bedb","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"execution":{"iopub.execute_input":"2022-09-25T01:17:27.643794Z","iopub.status.busy":"2022-09-25T01:17:27.642205Z","iopub.status.idle":"2022-09-25T01:17:27.899066Z","shell.execute_reply":"2022-09-25T01:17:27.896762Z"},"papermill":{"duration":0.270043,"end_time":"2022-09-25T01:17:27.901748","exception":false,"start_time":"2022-09-25T01:17:27.631705","status":"completed"},"tags":[]},"outputs":[{"dat