"%m/%d/%Y\", tz=Sys.timezone())"]},{"cell_type":"markdown","id":"775d890f","metadata":{"papermill":{"duration":0.010497,"end_time":"2022-09-25T01:17:28.134927","exception":false,"start_time":"2022-09-25T01:17:28.12443","status":"completed"},"tags":[]},"source":["Now it looks better 🤩  \n","  Next we will execute some statistical summarization of the datasets. As the research on step counts and mortality by The Centers for Disease Control and Prevention [(CDC)](https://www.cdc.gov/media/releases/2020/p0324-daily-step-count.html) tell us that it appears to be a significant difference in the average number of steps taken by females and males. From childhood through adulthood, males tend to walk more. As children and teens, they walk an average of 12,000 to 16,000 steps per day. Young females, on the other hand, get 10,000 to 12,000.  The summary of activity dataset shows that the average of users walk almost 7,500 steps daily in average, besides Sundays. "]},{"cell_type":"code","execution_count":6,"id":"ac5265ac","metadata":{"execution":{"iopub.execute_input":"2022-09-25T01:17:28.159709Z","iopub.status.busy":"2022-09-25T01:17:28.158148Z","iopub.status.idle":"2022-09-25T01:17:28.280086Z","shell.execute_reply":"2022-09-25T01:17:28.278135Z"},"papermill":{"duration":0.13744,"end_time":"2022-09-25T01:17:28.283229","exception":false,"start_time":"2022-09-25T01:17:28.145789","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["  total_steps    total_distance   sedentary_minutes    calories   \n"," Min.   :    0   Min.   : 0.000   Min.   :   0.0    Min.   :   0  \n"," 1st Qu.: 3790   1st Qu.: 2.620   1st Qu.: 729.8    1st Qu.:1828  \n"," Median : 7406   Median : 5.245   Median :1057.5    Median :2134  \n"," Mean   : 7638   Mean   : 5.490   Mean   : 991.2    Mean   :2304  \n"," 3rd Qu.:10727   3rd Qu.: 7.713   3rd Qu.:1229.5    3rd Qu.:2793  \n"," Max.   :36019   Max.   :28.030   Max.   :1440.0    Max.   :4900  "]},"metadata":{},"output_type":"display_data"},{"da