 2016'\" ,\n","  )"]},{"cell_type":"markdown","id":"174e9f00","metadata":{"papermill":{"duration":0.016436,"end_time":"2022-09-25T01:17:31.313994","exception":false,"start_time":"2022-09-25T01:17:31.297558","status":"completed"},"tags":[]},"source":["So as we can see there are other elements involved in calorie burning during the day and as a result, the correlation between total calorie burning and distance traveled on the weekdays is not strong.  \n","  According to the sleep physicians and scientists of National Center for Chronic Disease Prevention and Health Promotion[(NCCDPHP)](https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html) and [Sleep Foundation](https://www.sleepfoundation.org/how-sleep-works/how-much-sleep-do-we-really-need) studies, it is highly recommended for adults to have at least 7~9 hours or on average 8 hours of sleeping time. So let's apply it to our results.\n","\n","Now let's check out the distribution of sleep minutes per every 24 hours for the participants of this dataset, considering the recommended sleeping hours by our resources."]},{"cell_type":"code","execution_count":10,"id":"56e9b9bb","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-25T01:17:31.351254Z","iopub.status.busy":"2022-09-25T01:17:31.349634Z","iopub.status.idle":"2022-09-25T01:17:31.786027Z","shell.execute_reply":"2022-09-25T01:17:31.784045Z"},"papermill":{"duration":0.457634,"end_time":"2022-09-25T01:17:31.788334","exception":false,"start_time":"2022-09-25T01:17:31.3307","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2BTVR/H8XMzuzfQxd6jTNlli0wREBAcDJkiG0SUDYqKskRBHCgIAg8CIgoo\nIHsKAsoSlCEbSgfpSJsm93kRqKWLFNqmPX4/r3JPzj3nn9vQ/rhTUVVVAAAAoODTOLsAAAAA\n5AyCHQAAgCQIdgAAAJIg2AEAAEiCYAcAACAJgh0AAIAkCHYAAACSINgBAABIokAGO6v5ny/e\nGdWyQdVCvl56ncHLP7hW0w4T5/8vxvrAzZZ/f6+2oigt1l90UpnZM6e0r6IoG6PM9sUjb1RX\nFKXNzms5PlGakYeGeCqKciYhOccnynA6AACQe3T