rding the conclusions.  \n","  And finally, let's review our results together."]},{"cell_type":"markdown","id":"12157bae","metadata":{"papermill":{"duration":0.031435,"end_time":"2022-09-25T01:17:37.99293","exception":false,"start_time":"2022-09-25T01:17:37.961495","status":"completed"},"tags":[]},"source":["# Summary\n","### Share and Act Phase\n","\n","![](https://img.freepik.com/free-vector/creative-team-concept-illustration_114360-3894.jpg?size=626&ext=jpg&ga=GA1.2.2106813229.1651349321)\n","\n","\n","It is well known that the data science and data analysis on smart health gadgets has allowed many high-tech companies to help people all over the globe about their own health and even possible future problems. Bellabeat is a high-tech company with women health care mission since 2013, with the help of science and a great community of analysts, Bellabeat quickly defined its brand as a technological and data-driven healthcare company for women.  \n","  This project focused on business tasks and to help Bellabeat on their mission which is improving women's health through great data analytics projects. Personally I prefer to gather and use my own tracking data for further analysis through multiple smart watches and other health-care gadgets.  \n","  Also it is noticable that datasets that we used here has a small range of participants and is possible to be biased since we didn't have any details of users. Assuming that our main targets are young and adult women, it is highly recommended to search for more reliable datasets to have a consistant patterns and algorithms for having a correct business and marketing stragety.\n","\n","  During our project we have found some patterns that may answer the business tasks and improve **Bellabeat app** experience: \n","\n","| Recommendation | Description |\n","|---| ---|\n","|1. Motivational notifications on application and social media|We need to encourage users to reach at least daily recommended steps by CDC which is 10,000 to 12,000 for young females and 12,000 to 16,000 for young males by  **sending them notifications and motivational messages if they haven't reached the steps, calorie count or target distance** and **crefting social media or in-app contents for explaining the benefits of reaching the goals**.|\n","|3. Sleep quality records| Based on our results we can see that many users doesn't have the sleep quality.. **We need to include setting time to go to sleep and receive a notification for cooldawn and being ready for bed to them to let them be prepared to go in bed**. |\n","|2. Achievements league | Some people don't get motivated by notifications since they are so busy and focused in daily tasks, so we could create a achievement system or ranking system in the application with sharing capacity and create a challenge in social media based on it. **Rankings would consist in reaching higher levels based on amount of activity or exercise every user might have**. This might be the most important step that this company should take based on this analysis.|\n","\n","* *As there is no gender information about the participants, I assumed that all genders were presented and balanced in this data set.* \n","\n","\n","\n","\n"]},{"cell_type":"markdown","id":"a34af491","metadata":{"papermill":{"duration":0.032954,"end_time":"2022-09-25T01:17:38.057444","exception":false,"start_time":"2022-09-25T01:17:38.02449","status":"completed"},"tags":[]},"source":["# Conclusions\n","\n","### Ideas and recommendations\n","\n","1. Activity dataset shows that average steps per day recorded by users are 7638 which is not enough for having health benefits according to the CDC research. We need to invent an achievement system or competition league for users to take more steps and distance per day.\n","\n","2. Categories for a health-care gadget is required to be extended by multiple sports categories and exercise recorders. We could offer to the technical and hardware engineer team to consider including gyroscope, altimeter, gps, barometer, body-temp sensor, heartbeat sensor, BP sensor and so on.\n","\n","3. The importance of sleep quality is not hidden for anyone these days, so Bellabeat can consider using sleep tracker sensor, snore sensor and advanced in-app notifications relevant to sleep quality, also offer helpfull resources for a better sleep quialty such as: breathing reminders, podcasts with relaxing music and meditation recommendations.\n","\n","4. In modern lifesyle most activities happens between 5:00 and 7:00 pm. Many people go to the gym or for a run or walk after finishing work. Bellabeat can use this period to remind and highly motivate users to begin their physical activity.\n","\n","5. Sedentary records are worrying in these datasets so the gyroscope and pedometer need to remind the user to have at least 5 minutes of walking around.\n","\n","\n","\n","\n","\n","\n","![](https://blog.fitbit.com/wp-content/uploads/2018/03/0328-self-control-blog-HERO.jpg)\n","\n","This project by [Yousef Moterassed](https://www.kaggle.com/yousefmoterassed) and is dedicated for Bellabeat company's research team to have an analysis through FitBit users data and is available through Kaggle, GitHub, [my website](https://yousefmoterassed.wixsite.com/profile) and [LinkedIn](https://www.linkedin.com/in/yousef-moterassed/).\n","\n","\n","Thank you for your time and I hope you enjoyed my case study analysis.  \n","  With the best regards  \n","  **Yousef Moterassed**  \n","  🎫📱: [@persabras](http://instagram.com/persabras)"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":16.330133,"end_time":"2022-09-25T01:17:38.213625","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-25T01:17:21.883492","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}